import Layout from '../components/CommonLayout.js'
import Link from 'next/link'




export default () => (
  <Layout>
    <Head>
        <title>Strickland Auto</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    </Head>
    <h1>My Blog</h1>
    <style jsx>{`
      h1, a {
        font-family: "Arial";
      }

      ul {
        padding: 0;
      }

      li {
        list-style: none;
        margin: 5px 0;
      }

      a {
        text-decoration: none;
        color: blue;
      }

      a:hover {
        opacity: 0.6;
      }
    `}</style>
  </Layout>
)
